뇌피셜;
신조어중 하나. 뇌(腦)와 오피셜(Official, 공식 입장)의 합성어로, 자기 머리에서 나온 생각이 사실이나 검증된 것 마냥 말하는 행위를 뜻한다. 또는 '뇌 내에서만 공식적인 생각', 즉 '자신의 뇌세포들만 공식적으로 인정하는 생각' 이라고 해석할 수도 있다.   라고 하는데 배댓좀 만들어줘 다른사람 다 볼수있게.

야 만강이가 그래도 북한에서 훈련받고왔는데 ;
마동석형님은 주먹으로 헬맷후드려팼는데
북한에서 훈련받고 너는 당구공으로치냐 ㅡㅡ

